import React, { useEffect, useState } from "react";
import "./App.css";
import axios from "axios";

import { Container, Table, TopRow, Row, Cell } from "./Styles";

interface Employee {
  id: number;
  firstName: string;
  lastName: string;
  email: string;
}

function App() {
  const [employees, setEmployees] = useState<Employee[]>([]);

  const getEmployees = () => {
    axios.get("http://localhost:8080/employees/").then((response) => {
      console.log(response);
      console.log(response.data);
      const myRepo = response.data;
      setEmployees(myRepo);
    });
  };

  useEffect(() => getEmployees(), []);

  return (
    <div className="App">
      <Container>
        <Table>
          <TopRow>
            <Cell>First Name</Cell>
            <Cell>Last Name</Cell>
            <Cell>Email</Cell>
          </TopRow>
          {employees.map((employee) => (
            <Row>
              <Cell>{employee.firstName}</Cell>
              <Cell>{employee.lastName}</Cell>
              <Cell>{employee.email}</Cell>
            </Row>
          ))}
        </Table>
      </Container>
    </div>
  );
}

export default App;
